import  React from 'react';
import  './App.css';
import  Boss  from './Boss'

import  { Route } from 'react-router-dom';
import  { BrowserRouter } from 'react-router-dom';


function App() {

  return (
    <div className="App">
        <BrowserRouter>


          <Route path="/boss" exact component={Boss} />    

        </BrowserRouter>
    </div>
  );
}

const mapStateToProps = (state) => {
  return state;
}

export default App;
